import React from 'react';
import ReactDOM from 'react-dom';
import 'semantic-ui-css/semantic.min.css';
import { Route, Routes } from 'react-router-dom';
import { ConnectedRouter } from 'connected-react-router';
import { Provider } from 'react-redux';
import { history, store } from './store';
import * as serviceWorker from './serviceWorker';

import Dashboard from './component/Dashboard';
import MasterForm from './component/MasterForm';
import LoginForm from './component/LoginForm';
import AddMobilityForm from './component/AddMobilityForm';
import EditMobilityForm from './component/EditMobilityForm';
import CaseRecord from './component/CaseRecord';
import MovementMap from './component/MovementMap';
import UserProfile from './component/UserProfile';
import interactiveMap from './component/interactiveMap';  // Ensure consistent casing

ReactDOM.render(
    <Provider store={store}>
        <ConnectedRouter basename='/mozzhub' history={history}>
            <Routes>
                <Route path="/" element={<Dashboard />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/form" element={<MasterForm />} />
                <Route path="/addMob" element={<AddMobilityForm />} />
                <Route path="/editMob" element={<EditMobilityForm />} />
                <Route path="/record" element={<CaseRecord />} />
                <Route path="/login" element={<LoginForm />} />
                <Route path="/map" element={<MovementMap />} />
                <Route path="/logout" element={<LoginForm />} />
                {/* <Route path="/userprofile" element={<UserProfile />} /> */}
                <Route path="/interactivemap" element={<interactiveMap />} />
            </Routes>
        </ConnectedRouter>
    </Provider>,
    document.getElementById('root')
);

serviceWorker.register();
